import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";

import Grid from "@material-ui/core/Grid";

import ClassificadoPreview from "../classificado-preview/classificado-preview";

import { selectClassificadosForPreview } from "../../redux/classificado/classificado.selectors";

const ClassificadoOverview = ({ classificados }) => {
  return (
    <div className="classificado-overview">
      {classificados.map(({ id, ...otherProps }) => {
        return (
          <Grid justify="center" spacing={2}>
            <Grid key={id} item>
              <ClassificadoPreview key={id} {...otherProps} />
            </Grid>
          </Grid>
        );
      })}
    </div>
  );
};
const mapStateToProps = createStructuredSelector({
  classificados: selectClassificadosForPreview,
});

export default connect(mapStateToProps)(ClassificadoOverview);
